import logo from './logo.svg';
import './App.css';
import Services from './components/services';

function App() {
  return (
    <div className="App">
      <Hero/>
      <Services/>
      <div className="container">
      <h1 className="text-center my-4">Welcome to My React App</h1>
      <button className="btn btn-primary">Click Me!</button>
    </div>
    </div>
  );
}

export default App;
